import React from "react";
import { Navbar, Nav, Button } from "react-bootstrap";
import { useHistory } from "react-router-dom";

const NavigationBar = () => {
	const history = useHistory();

	const handleHome = () => {
		history.push("/"); // This should be the path to your home page
	};

	const handleSearch = () => {
		history.push("/search"); // This should be the path to your search page
	};

	return (
		<Navbar
			bg='light'
			expand='lg'>
			<Navbar.Brand href='/'>ReceptBok</Navbar.Brand>
			<Navbar.Toggle aria-controls='basic-navbar-nav' />
			<Navbar.Collapse id='basic-navbar-nav'>
				<Nav className='mr-auto'>
					<Button
						variant='outline-primary'
						onClick={handleHome}>
						Hem
					</Button>
					<Button
						variant='outline-primary'
						onClick={handleSearch}
						className='ml-2'>
						SÃ¶k
					</Button>
				</Nav>
			</Navbar.Collapse>
		</Navbar>
	);
};

export default NavigationBar;
